TITLE:
  - "Test case for electrode-electrolyte interface coupling:"
  - "- based on results in Goldin et al., Electrochimica Acta 64 (2012) 118-129"
  - "- three-dimensional problem with two two-dimensional electrode-electrolyte interfaces"
  - "- spherical anode particle, electrolyte, and spherical cathode particle, each with"
  - "constant initial lithium concentrations and electric potentials"
  - "- charge transfer kinetics characterized by Butler-Volmer equation"
  - "- discharge from fully charged state at C rate of 10"
  - "- 1276 tet4 elements with non-matching interface nodes"
